import React, { useState } from 'react';
import { useTranslation } from 'react-i18next';
import { reduceEachLeadingCommentRange } from 'typescript';

const FeedList = () => {

    const [pagingFeed, setPagingFeed] = useState({
        content: [],
        page: 0,
        number: 0
    });
    const { t } = useTranslation();

    if (pagingFeed.content.length === 0)
        return (<div><div className="alert alert-danger text-center" role="alert">
            {t("There are no messages")}
        </div></div>)

    return (
        <div>
            {
                pagingFeed.content.map((feed: any) => { return feed.content; })
            }

        </div>
    );
};

export default FeedList;
